"use strict";

// padding no-ios
document.addEventListener("DOMContentLoaded", function () {
  var txtMagenta = document.querySelector('.txtMagenta');
  var txtBlue = document.querySelectorAll('.txtBlue');
  var bonusTop = document.querySelectorAll('.bonusItem__txt-top');
  var bonusBottom = document.querySelectorAll('.bonusItem__txt-bottom');
  var centerFs = document.querySelectorAll('.welcome__center-fs-left');
  var centerFsR = document.querySelectorAll('.welcome__center-fs-right');
  var bigBtn = document.querySelectorAll('.depositBtn.big');
  var smallBtn = document.querySelectorAll('.depositBtn');
  var rules = document.querySelectorAll('.dropdown summary');
  if (!/iPad|iPhone|iPod|Mac/.test(navigator.userAgent)) {
    txtMagenta.classList.add('noios-padding');
    txtBlue.classList.add('noios-padding');
    centerFs.classList.add('noios-padding');
    centerFsR.classList.add('noios-padding');
    bigBtn.classList.add('noios-padding');
    smallBtn.classList.add('noios-padding');
    rules.classList.add('noios-padding');
    bonusTop.forEach(function (pageLoveBlock) {
      bonusTop.classList.add('noios-padding');
    });
    bonusBottom.forEach(function (pageLoveBlock) {
      bonusBottom.classList.add('noios-padding');
    });
  }
});

// TEST
document.querySelector('.dark-btn').addEventListener('click', function () {
  document.body.classList.toggle('dark');
});
